Mercy Sparx Vol. 1

English | CBR | 1 Issue

Genre: Supernatural/Fantasy

Written by Josh Blaylock

Art by Matt Merhoff

Collects Mercy Sparx Vol. 1 #0-4!

Meet Mercy Sparx, a devil girl hired by the big shots in heaven to secretly take down rogue angels. Follow our unlikely heroine as she battles the forces of 'good' while trying to figure out which side is the lesser evil. It's either succeed and get a free pass through the Pearly Gates, or fail and risk going somewhere very bad indeed!

